/**
 * This function splits a given string into substrings based on a list of separators.
 * It returns a formatted string containing the substrings and their corresponding separators.
 *
 * @param str The input string to be split.
 * @param separators A list of separator strings.
 * @return A formatted string containing the substrings and their corresponding separators.
 */
string Multisplit(const string& str, const vector<string>& separators) {
    // Initialize an empty vector to store the result substrings
    vector<string> result;

    // Initialize the separator index to 0
    int separator_index = 0;

    // Initialize an empty stack to keep track of the delimiter indices
    vector<int> delimiter_stack;

    // Iterate over each character in the input string
    for (int i = 0; i < str.size(); ++i) {
        // Check if the current character matches any separator
        for (int j = separator_index; j < separators.size(); ++j) {
            // If the current character matches a separator, update the separator index and delimiter stack
            if (str.substr(i, separators[j].size()) == separators[j]) {
                // Push the current separator index onto the delimiter stack
                delimiter_stack.push_back(j);

                // Update the separator index to the next separator
                separator_index = j + 1;

                // Break out of the inner loop to continue with the next character
                break;
            }
        }

        // If no separator is found, add the current substring to the result and continue
        if (j >= separators.size()) {
            // Add the current substring to the result vector
            result.push_back(str.substr(i));

            // Continue with the next character
            continue;
        }

        // Add the matched separator information to the result
        result.push_back(separators[j] + " at position " + to_string(i));
    }

    // Pop the delimiter stack and append matching substrings to the result
    for (int i = delimiter_stack.size() - 1; i >= 0; --i) {
        int delimiter_index = delimiter_stack[i];

        // Append the matching substring to the result
        if (!result.empty()) {
            result.back() = result.back() + " " + separators[delimiter_index] + " at position " + to_string(i);
        }

        // Pop the current delimiter index from the stack
        delimiter_stack.pop_back();
    }

    // Format the result as a single string and return it
    string formatted_result = "";
    for (const string& s : result) {
        formatted_result += s + " ";
    }

    // Remove the trailing space from the formatted result
    if (!formatted_result.empty()) {
        formatted_result.pop_back();
    }

    return formatted_result;
}

